const database = {
    questions: [],
    names: [],

    addSpm(spm) {
        this.questions.push(spm);
    },

    addName(name) {
        this.names.push(name);
    },

    getSpm() {
        let question = this.questions[Math.floor(Math.random() * this.questions.length)];
        this.questions.splice(this.questions.indexOf(question), 1);
        return question;
    },

    getNames() {
        return this.names;
    },

}

export default database;
